import React from "react";
import './contacts.css';
import img from '../../images/contact.svg';

export default function Contacts(){
    return(
        <>
        <div className="contacts" id="contacts">
            <div className="left">
                <img src={img} alt="" />
            </div>
            <div className="right">
                 <div className="form">
                     <h1>Contact Me</h1>
                     <input type="email" id="input" placeholder="  Email" />
                     <textarea name="text" id="text" placeholder=" Type message" cols="20" rows="7"></textarea>
                     <button>Send</button>
                 </div>
                 <h2>Hii, I'll reply You ASAP!</h2>
            </div>
        </div>
        </>
    );
}
